import Recipe from "./Recipe";

export default function RecipeList(recipeProps) {
  const recipes = recipeProps;
  return (
    <>
      <div>
        <h1>Recipe List</h1>
        <div className="API">
          {recipes.map((recipe) => (
            <Recipe key={recipe.id} recipe={recipes} />
          ))}
        </div>
      </div>
      <Recipe />
    </>
  );
}
